import "./rvEvent.css";
export const RevealContentLayout = ()=>{
    return (
      <>
        <div className="rv-ct-layout">
          <p>
            Our 2021 model range is ready to be revealed. This page will host
            our latest model launches.
          </p>
          <br></br>
          <p>
            The most complete range of connected motorcycles, safety features
            update and brand new models are just around the corner.
          </p>
          <br className="xc"></br>
          <p>Follow our schedule of events during the next months.</p>
        </div>
      </>
    );
}
